"use strict";(()=>{const e=document.querySelectorAll(".needs-validation");Array.from(e).forEach(e=>{e.addEventListener("submit",t=>{e.checkValidity()||(t.preventDefault(),t.stopPropagation()),e.classList.add("was-validated")},!1)});document.querySelectorAll(".carousel").forEach(e=>new bootstrap.Carousel(e,{interval:!1}))})();